import React, { useState } from 'react';
import './App.css';

function App() {
  const [searchInput, setSearchInput] = useState('');

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Searching for:', searchInput);
    // Handle search logic here
  };

  const foodImages = [
    { src: '/food_pics/pizza.svg', alt: 'Pizza' },
    { src: '/food_pics/burger.svg', alt: 'Burger' },
    { src: '/food_pics/pasta.svg', alt: 'Pasta' },
    { src: '/food_pics/salad.svg', alt: 'Salad' },
    { src: '/food_pics/sushi.svg', alt: 'Sushi' },
    { src: '/food_pics/cake.svg', alt: 'Cake' },
    { src: '/food_pics/icecream.svg', alt: 'Ice Cream' }
  ];

  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="nav-container">
          <div className="nav-left">
            <span className="nav-item">Home</span>
          </div>
          <div className="nav-center">
            <span className="nav-item">Recipes</span>
            <span className="nav-item">Update Fridge</span>
          </div>
          <div className="nav-right">
            <span className="nav-item">Login</span>
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <div className="main-content">
        {/* Animated Food Images in Circle */}
        <div className="food-circle">
          {foodImages.map((food, index) => (
            <div
              key={index}
              className="food-item"
              style={{
                '--rotation': `${(index * 360) / foodImages.length}deg`,
                '--delay': `${index * 0.5}s`
              }}
            >
              <img src={food.src} alt={food.alt} className="food-image" />
            </div>
          ))}
        </div>

        <div className="hero-section">
          <h1 className="hero-title">Create Something Delicious</h1>

          <form className="search-form" onSubmit={handleSearch}>
            <div className="search-container">
              <input
                type="text"
                placeholder="What ingredients do you have?"
                value={searchInput}
                onChange={(e) => setSearchInput(e.target.value)}
                className="search-input"
              />
              <button type="submit" className="search-button">
                <span className="arrow">â†’</span>
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
